import './App.css';
import React from 'react';
import { Link, Route, Routes, BrowserRouter} from "react-router-dom";
import Home from './Home';
import Result from './result';


function App() {
  return (
    <div className="App">

        <Routes>
          <Route path='/' element={<Home/>}/>
          <Route exact path="/result" element={<Result/>}></Route>
        </Routes>

    </div>
  );
}

export default App;
